import React, { Component } from "react";

import KacangProduct from '../medium/productkacang';
import TraditionalProduct from '../medium/producttraditional';
import NavigationBar from '../medium/navbar';

class ProductSnack extends Component {
  render() {
     return (
     <div>
       <NavigationBar/>
       <TraditionalProduct/>
       <KacangProduct/>
     </div>
     );
  }
}

export default ProductSnack;
